import React from 'react';

import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';

import logoFrance from '../../assets/images/logos/roundnet-france.jpg';
import logoCoc from '../../assets/images/logos/roundnet-coc.jpg';
import logoLyon from '../../assets/images/logos/roundnet-lyon.jpg';

function Footer() {
  const rawLogos = [
    {
      src: logoFrance,
      alt: 'Roundnet France',
    },
    {
      src: logoCoc,
      alt: 'Roundnet COC',
    },
    {
      src: logoLyon,
      alt: 'Roundnet Lyon',
    },
  ];

  return (
    <Box bgcolor="primary.dark" py={4}>
      <Container maxWidth="md">
        <Stack direction="row" alignItems="center">
          <Typography variant="h6" color="white">
            Roundnet France Ranking
          </Typography>
          <Box>
            {rawLogos.map((logo) => (
              <img
                key={logo.src}
                src={logo.src}
                alt={logo.alt}
                width="80px"
              />
            ))}
          </Box>
        </Stack>
      </Container>
    </Box>
  );
}

export default Footer;
